import logo from "./logo.svg";
import "./App.css";
import Loginform from "./components/loginform";
import { useState } from "react";
import Bloglist from "./components/Bloglist";
import Postingblogs from "./components/postinblogs";

function App() {
  const [user, setUser] = useState("");
  const [token, setToken] = useState("");
  const [name, setName] = useState("");

  if (!token) {
    return (
      <div className="App">
        <Loginform setToken={setToken} setUser={setUser} setName={setName} />
      </div>
    );
  } else if (token !== "") {
    return (
      <body>
        <p>{`${user} (${name}) logged in`}</p>
        <div>
          <Postingblogs />
        </div>
        <div>
          <Bloglist user={user} name={name} />
        </div>
      </body>
    );
  }
}

export default App;
